Hi,
I have built onnxRuntime from source where I can use a .onnx model to predict output  in python. I would like to do same prediction in C++, I need guidance on that how to proceed (e.g loading the .onnx model, printing outputs etc.) I found 
#include "onnx/onnx.pb.h"
#include <fstream>
#include <iostream>

int main(void) {
        onnx::ModelProto model;
        std::ifstream in("mnist.onnx", std::ios_base::binary);
        model.ParseFromIstream(&in);
        in.close();
        std::cout<<model.graph().input().size()<<"\n";
}
but I am using onnxRuntime I don't see onnx/onnx.pb.h there. Please help.
Thanks,
Debottam

**Bug description**
Batch prediction only returns a single prediction.

**System information**
- OS Platform and Distribution: MacOS Mojave 10.14.6
- ONNX Runtime installed from latest [release](https://github.com/microsoft/onnxruntime/releases)
- ONNX Runtime version: Microsoft.ML.OnnxRuntime (0.5.0
- Visual Studio version: 8.2.5 (build 5)

**To Reproduce**
```csharp
float width = 1.0;
float height = 2.0;

float[] sourceData = { width, height };
int[] dimensions = { 1, 2 };

Tensor<float> t1 = new DenseTensor<float>(sourceData, dimensions);
var inputs = new List<NamedOnnxValue>(){
    NamedOnnxValue.CreateFromTensor<float>("float_input", t1),
    NamedOnnxValue.CreateFromTensor<float>("float_input", t1),
    NamedOnnxValue.CreateFromTensor<float>("float_input", t1)
};

using (InferenceSession session = new InferenceSession(modelPath)) {
    using (var results = session.Run(inputs)) {
        // results only contain 1 prediction
        foreach (var r in results) {
            if(r.Name == "label") {
                log.LogInformation($"{r.AsTensor<Int64>().GetValue(0)}");
            }
        }
    }
}
```
**Expected behavior**
Expected `results` to contain 3 predictions. I went into the debugger to make sure I was parsing right : 
<img width="1094" alt="Screenshot 2019-09-10 at 22 56 46" src="https://user-images.githubusercontent.com/3611896/64650013-6b8cae80-d41e-11e9-8099-6aa0e7418d0b.png">

**Additional context**
The kmeans model I am doing predictions for was trained with `scikit-learn` then exported to ONNX. Querying the same model with python's `onnxruntime` library behaves as expected.

What is the easiest way to track all heap memory consumption from ORT via the C API?

I had the idea to create my own allocator that simply feeds calls straight into the default allocator (created with `OrtCreateDefaultAllocator`).

However, there is no `void* userdata` on the allocator functions. See here:

```cpp
typedef struct OrtAllocator {
  uint32_t version;  // Initialize to ORT_API_VERSION
  void*(ORT_API_CALL* Alloc)(struct OrtAllocator* this_, size_t size);
  void(ORT_API_CALL* Free)(struct OrtAllocator* this_, void* p);
  const struct OrtAllocatorInfo*(ORT_API_CALL* Info)(const struct OrtAllocator* this_);
} OrtAllocator;
```

How is one supposed to create a default allocator if the `Alloc` and `Free` functions do not even have a proper userdata parameter?

For now I've had to typecast `this_` to my own internal type, which is quite awkward and leads to me ask this question.

Additionally, the free function does not have the size of the allocation. So knowing the size of free'd memory is non-trivial. If we look at the implementation of the default alloc, we can see it's aligning to some run-time value as decided by MLAS.

```cpp
void* DefaultAlloc(size_t size) {
  if (size <= 0) return nullptr;
  void* p;
  size_t alignment = MlasGetPreferredBufferAlignment();
#if _MSC_VER
  p = _aligned_malloc(size, alignment);
  if (p == nullptr) throw std::bad_alloc();
#elif defined(_LIBCPP_SGX_CONFIG)
  p = memalign(alignment, size);
  if (p == nullptr) throw std::bad_alloc();
#else
  int ret = posix_memalign(&p, alignment, size);
  if (ret != 0) throw std::bad_alloc();
#endif
  return p;
}
```

Usually alloc functions have alignment passed to them as a parameter. This way higher level allocators can call into lower level allocators with extra padding information (to store bookkeeping, like the allocation size).

It seems to me not possible to track memory consumption due to way the `OrtAllocator` API is designed.
